text:
Posted on October 05, 2025. I'll come back to this in 10 years:

When I first saw Lee Chae Min in Crash Course Romance, his acting was actually the first thing that caught my attention. He just nailed his scenes there, no matter how small they were. I just realized in later scenes that he's tall and not so bad-looking. He was still young, still needed a few styling sessions,  but I immediately recognized that I was looking at a future superstar.

I thought he may still appear in a high school-themed series, as well as a few more supporting roles, so I forgot about him after Crash Course Romance because I normally do not watch high school drama. I did not know when that would happen, but it will. He will resurface on my feed with a bang. That talent and looks is just impossible to ignore.

So, when I heard that LCM replaced PSH, I was happy that LCM would finally get a spotlight with Yoona. I didn't know that was the story, but I had a good feeling that it would work out, since it's a romance; if there are heavy dramatic scenes, even better. That's his edge among South Korean actors his age. My expectations were extremely high, but he exceeded them. I watch a wide range of series and movies from various countries, and I've been a K-drama fan since 2004. I am very critical of actor's acting.

I will make very bold predictions: Not only that, 
(1) he will win the Best Actor in Baeksang;  
(2) he will become the highest-paid A-list South Korean actor in less than 5 years;
(3) he will become the most awarded South Korean actor;
(4) he will become the highest-grossing South Korean actor;
(5) and maintain that status for over 20 years, even if he gets married.

