간만에 몰입해서 보는 드라마~
윤아 연기 오글거리지 않고 자연스러워 좋고 남주 연기 넘 좋아서 필모도 찾아봄 일타스캔들도 본거고 오며가며 본거 같은데 이번 역할 넘 찰떡같이 잘 소화함 마스크도 성형느낌 없어서 그런건지 보면서도 부담스럽지 않고 넘 멋...있음^^;
담주 빨리 와라~~~
